import React from 'react';
import { MDBIcon, MDBContainer, MDBBtn } from 'mdbreact';


const Header = (props) => {
return( 
<div className="container">
<div className="header">
<MDBContainer>
      <MDBBtn size="lg" tag="a" floating social="fb">
        <MDBIcon fab icon="facebook-f" />Facebook
      </MDBBtn>
      </MDBContainer>
    <button type="button" class="btn btn-dark btn-circle btn-xl" onClick= {() =>props.onclick(1)}><i class="fa fa-question"></i></button> 
</div>
</div>
) }

export default Header
